⠀
Yes Sicko by Amo Jones had ruined me. I had massive book hangover after reading this book. But when it was time to pick up the next read I couldn't decided what to read. Nothing was interesting enough! It got me frustrated! I am a mood reader and when my mood and emotions were all over the place I just couldn't read. 
⠀
I think for a first time ever I was in a reading slumb.😭 It wasn't long but I think it ws it. So I decided to share how I got out of it.
⠀
So after almost two weeks without reading I decided to get back to it by re-reading something I knew I would like. But the frustrating question still remains WHAT TO READ?!
⠀
Serching through my Kindle I remembered that had some audiobooks in @audible. Now, English isn't my native language so I don't have many because listening to a audiobooks requires from me a lot of focus. But I have some titles that I have read before (it is so much easier to focus and learn that way). So I thought that I would play it as background and if it will catch my attention then good if not then I will try something else.
⠀
And it worked! Listening to the 𝑼𝒏𝒕𝒊𝒍 𝒕𝒉𝒆 𝑺𝒖𝒏 𝒇𝒂𝒍𝒍𝒔 𝑭𝒓𝒐𝒎 𝒕𝒉𝒆 𝑺𝒌𝒚 by @kristenashleybooks, book that is in different genre than my last one, helped me focus my attention on something else and reminded me how much I love fantasy books. I haven't read anything in this genre for some time now!
⠀
So to those who are in a reading slumb, my advice is: re-read something you know you would like or try to play audiobooks as something in the background noise as you do house chores it my get your attention!
⠀
